scriptlet.script:
protocol = scriptletContext.get("protocol");
error = scriptletRawResult['exception'];
result = scriptletRawResult['Result'];
returnCode = scriptletRawResult['returnCode'];
stdErr = scriptletRawResult['stdErr'];
if (returnCode == -1)
{
    if ((error == null) || (error == ""))
    {
        if ((stdErr == "" ) || (stdErr == null))
            error = "Could not get information";
        else  
           error = stdErr;
     }
     scriptletContext.put("Error String", error);
}
else if ((protocol.indexOf("Telnet") != -1) && (error == null))
{
    if (result.toLowerCase().indexOf("not found") != -1)
    {
         scriptletContext.put("Code", "-1");
         scriptletContext.put("Error String", result);
     }
     if (result.toLowerCase().indexOf("cannot execute") != -1)
      {
         scriptletContext.put("Code", "-1");
         scriptletContext.put("Error String", result);      
      }
}

var uptimeOutput = scriptletContext.get("uptimeOutput");

if (typeof uptimeOutput != 'undefined' && uptimeOutput != null && uptimeOutput.length() > 0) {
	var uptimeOutputSplit = uptimeOutput.split(" ");
	var length = uptimeOutputSplit.length;

	var fifteenMinuteParse = uptimeOutputSplit[length-1].replace(",","").trim();
	var fiveMinuteParse = uptimeOutputSplit[length-2].replace(",","").trim();
	var oneMinuteParse = uptimeOutputSplit[length-3].replace(",","").trim();

	scriptletContext.put("oneMinuteParse", oneMinuteParse);
	scriptletContext.put("fiveMinuteParse", fiveMinuteParse);
	scriptletContext.put("fifteenMinuteParse", fifteenMinuteParse);
}
